import classes from './styles/projects.module.css'

function Projects() {
    return (
       <div className={classes.Projects}>

        <h1>Projects</h1>

          <div className={classes.card}>
              <h2>Título</h2>
                <button className={classes.btn}>
                  Um botão
                </button>
          </div>
        </div>
    );
  }

export default Projects;
